// App.js
import React, { useState, useEffect } from 'react';
import SplashScreen from './SplashScreen';
import './styles.css';

function App() {
  // Whether the splash screen is still visible
  const [showSplash, setShowSplash] = useState(true);
  // Class to trigger fade-out animation
  const [fadeClass, setFadeClass] = useState('');
  // Which page to display after the splash screen: 'upload' or 'results'
  const [page, setPage] = useState('upload');
  // File state to hold the selected file from the input
  const [file, setFile] = useState(null);
  // State for storing prediction results from the backend API
  const [results, setResults] = useState(null);
  // Loading state for the file upload
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    // Show splash for 3 seconds then fade out over 1 second
    const timer = setTimeout(() => {
      setFadeClass('fade-out');
      setTimeout(() => {
        setShowSplash(false);
      }, 1000);
    }, 3000);
    return () => clearTimeout(timer);
  }, []);

  // Handle file selection
  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  // Handle file upload and API call
  const handleUpload = async () => {
    if (!file) return;
    setLoading(true);
    const formData = new FormData();
    formData.append('file', file);

    try {
      // Adjust the URL if needed
      const response = await fetch('http://127.0.0.1:8000/predict', {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        throw new Error("Upload failed");
      }

      const data = await response.json();
      setResults(data);
      setPage('results');
    } catch (error) {
      console.error('Error uploading file:', error);
      // You could also display an error message to the user here
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App">
      {showSplash ? (
        // Splash screen with fade-out transition
        <div className={`splash-wrapper ${fadeClass}`}>
          <SplashScreen />
        </div>
      ) : (
        <div className="container">
          {page === 'upload' ? (
            // Upload page UI
            <div className="upload-section">
              <h1>GeneSight</h1>
              <h2>Upload Your Gene Expression Data</h2>
              <p>Get a quick and explainable risk assessment for disease prediction.</p>
              <div className="upload-controls">
                <input
                  type="file"
                  className="file-input"
                  onChange={handleFileChange}
                />
                <button
                  className="upload-button"
                  onClick={handleUpload}
                  disabled={loading}
                >
                  {loading ? 'Uploading...' : 'Upload Files Now'}
                </button>
              </div>
              {/* Optional: Add your holographic or futuristic genome visual here */}
              <div className="hologram">
                {/* Insert an image or canvas for the live genome hologram */}
                <img src="/path/to/hologram-image.png" alt="Live Genome Hologram" />
              </div>
            </div>
          ) : (
            // Results page UI
            <div className="results-section">
              <h1>GeneSight Results</h1>
              {results ? (
                <>
                  <p>Risk Score: <strong>{results.riskScore}</strong></p>
                  <h3>Top Influential Genes:</h3>
                  <ul>
                    {results.topFeatures.map((feature, index) => (
                      <li key={index}>
                        {feature.gene}: {feature.importance.toFixed(2)}
                      </li>
                    ))}
                  </ul>
                </>
              ) : (
                <p>No results to display.</p>
              )}
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default App;
